import React from 'react';
import {Button} from "antd";
export const Content00DataSource = {
  wrapper: { className: 'home-page-wrapper content0-wrapper' },
  page: { className: 'home-page content0 k34k7femq0k-editor_css' },
  OverPack: { playScale: 0.3, className: '' },
  titleWrapper: {
    className: 'title-wrapper',
    children: [
      {
        name: 'title',
        children: (
          <>
            <p>AI Lab</p>
          </>
        ),
        className: 'k34k32lya7-editor_css',
      },
    ],
  },
  childWrapper: {
    className: 'content0-block-wrapper',
    children: [
      {
        name: 'block0',
        className: 'content0-block',
        md: 8,
        xs: 24,
        children: {
          className: 'content0-block-item',
          children: [
            {
              name: 'image',
              className: 'content0-block-icon',
              children:
                'https://couseraccess.oss-cn-beijing.aliyuncs.com/images/fenxi-2.png',
            },
            {
              name: 'title',
              className: 'content0-block-title',
              children: (
                <>
                  <p>图像分析</p>
                </>
              ),
            },
            {
              name: 'content',
              children: (
                <>
                  <p>你选择的图片，我们都能帮它加上标签</p>
                </>
              ),
            },
          ],
        },
      },
      {
        name: 'block1',
        className: 'content0-block',
        md: 8,
        xs: 24,
        children: {
          className: 'content0-block-item',
          children: [
            {
              name: 'image',
              className: 'content0-block-icon',
              children:
                'https://couseraccess.oss-cn-beijing.aliyuncs.com/images/chuli-3.png',
            },
            {
              name: 'title',
              className: 'content0-block-title',
              children: (
                <>
                  <p>图像处理</p>
                </>
              ),
            },
            {
              name: 'content',
              children: (
                <>
                  <p>想要给图片加上梵高的风格？不是问题！</p>
                </>
              ),
            },
          ],
        },
      },
      {
        name: 'block2',
        className: 'content0-block',
        md: 8,
        xs: 24,
        children: {
          className: 'content0-block-item',
          children: [
            {
              name: 'image',
              className: 'content0-block-icon',
              children:
                'https://couseraccess.oss-cn-beijing.aliyuncs.com/images/fenlei-yanzhi.png',
            },
            {
              name: 'title',
              className: 'content0-block-title',
              children: (
                <>
                  <p>颜值打分</p>
                </>
              ),
            },
            {
              name: 'content',
              children: (
                <>
                  <p>来看看你的颜值差多少满分</p>
                </>
              ),
            },
          ],
        },
      },
    ],
  },
};
